column1:
@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:protoplanet rdfs:label "protoplanet" ;
    rdfs:subClassOf :astronomical_body ;
    :has_definition "An astronomical object that forms within a protoplanetary disc when planetesimals and other solid debris aggregate and, due to gravitational forces,  fuse and initiate internal melting to produce a differentiated interior." ;
    :has_exact_synonym "planetary embryo" .

:astronomical_body rdfs:label "astronomical body" .

,"A protoplanet, which is a subclass of astronomical body, is defined as an astronomical object that forms within a protoplanetary disc when planetesimals and other solid debris aggregate. Due to gravitational forces, these components fuse and initiate internal melting to produce a differentiated interior. Furthermore, protoplanet has an exact synonym, known as a planetary embryo."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:protoplanetary_disk rdfs:label "protoplanetary disk" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf ( :gaseous_environmental_material [ a owl:Restriction ;
                                owl:onProperty :has_quality ;
                                owl:someValuesFrom :dense ] ) ] ],
        :astronomical_object ;
    owl:equivalentClass [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf ( :gaseous_environmental_material [ a owl:Restriction ;
                                owl:onProperty :has_quality ;
                                owl:someValuesFrom :dense ] ) ] ] ;
    :has_definition "An astronomical object which is composed of dense gas and dust rotating around a young newly formed star, a T Tauri star, or a Herbig Ae/Be star in a disk-shaped configuration." .

:astronomical_object rdfs:label "astronomical object" .

:dense rdfs:label "dense" .

:gaseous_environmental_material rdfs:label "gaseous environmental material" .

:has_part rdfs:label "has part" .

:has_quality rdfs:label "has quality" .

,"The concept of a protoplanetary disk is essentially the same as having some values from the intersection of the dense quality of gaseous environmental material. This protoplanetary disk is a subclass of an astronomical object and is composed of some values from the intersection of the dense quality of gaseous environmental material. The definition of a protoplanetary disk is an astronomical object, which is composed of dense gas and dust rotating around a young newly formed star, a T Tauri star, or a Herbig Ae/Be star in a disk-shaped configuration."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:proplyd rdfs:label "proplyd" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :participates_in ;
            owl:someValuesFrom :photoevaporation ],
        :protoplanetary_disk ;
    owl:equivalentClass [ a owl:Restriction ;
            owl:onProperty :participates_in ;
            owl:someValuesFrom :photoevaporation ] ;
    :has_definition "A protoplanetary disk which is externally illuminated and undergoing photoevaporation." ;
    :has_exact_synonym "ionized protoplanetary disk" .

:protoplanetary_disk rdfs:label "protoplanetary disk" .

:participates_in rdfs:label "participates in" .

:photoevaporation rdfs:label "photoevaporation" .

,"The concept of proplyd and its participation in some values from photoevaporation are identical. Proplyd is a subclass of the protoplanetary disk and also participates in some values from photoevaporation. Proplyd can be precisely defined as a protoplanetary disk that is externally illuminated and undergoes photoevaporation. Furthermore, an exact synonym for proplyd is the ionized protoplanetary disk."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mesoplanet rdfs:label "mesoplanet" ;
    rdfs:subClassOf :planet ;
    :has_definition "A planet which is smaller than Mercury but larger than Ceres." .

:planet rdfs:label "planet" .

,A mesoplanet is a subclass of a planet which is defined as a planet that is smaller than Mercury but larger than Ceres.

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:circumbinary_planet rdfs:label "circumbinary planet" ;
    rdfs:subClassOf :planet ;
    :has_definition "A planet which orbits two stars." .

:planet rdfs:label "planet" .

,"A circumbinary planet, a sub-class of a planet, is defined as a planet that orbits two stars."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:volatile_astrogeological_material rdfs:label "volatile astrogeological material" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom [ owl:unionOf ( :atmosphere :planetary_crust ) ] ],
        :environmental_material ;
    :has_definition "A material which is composed primarily of chemical elements and compounds with relatively low boiling points, equilibrium condensation temperatures below 1300 Kelvin, and which are part of the crust or atmosphere of a moon or planet." ;
    :has_related_synonym "volatile" .

:atmosphere rdfs:label "atmosphere" .

:environmental_material rdfs:label "environmental material" .

:part_of rdfs:label "part of" .

:planetary_crust rdfs:label "planetary crust" .

,"Volatile astrogeological material is a subclass of environmental material. It's also a subclass of a category that is part of some values from the union of atmosphere and planetary crust. This material is primarily composed of chemical elements and compounds with relatively low boiling points, equilibrium condensation temperatures below 1300 Kelvin, and is part of the crust or atmosphere of a moon or planet. This is the definition of volatile astrogeological material. It also has a related synonym: 'volatile'."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:astrogeological_gas rdfs:label "astrogeological gas" ;
    rdfs:subClassOf :volatile_astrogeological_material ;
    :has_definition "An astrogeological volatile which is composed primarily of chemical compounds with boiling points around those of hydrogen and helium." ;
    :has_related_synonym "gas" .

:volatile_astrogeological_material rdfs:label "volatile astrogeological material" .

,"Astrogeological gas, which is a subclass of volatile astrogeological material, is primarily composed of chemical compounds with boiling points similar to those of hydrogen and helium. The term ""gas"" is also synonymously used to refer to astrogeological gas."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:refractory_astrogeological_material rdfs:label "refractory astrogeological material" ;
    rdfs:subClassOf :environmental_material ;
    :has_definition "A material which is composed primarily of chemical elements and compounds which have equilibrium condensation temperatures above approximately 1300 Kelvin and which are part of the crust or atmosphere of a moon or planet." ;
    :has_related_synonym "refractory material" .

:environmental_material rdfs:label "environmental material" .

,"Refractory astrogeological material, which is a sub-class of environmental material, is defined as a material composed primarily of chemical elements and compounds. These compounds have equilibrium condensation temperatures above approximately 1300 Kelvin and form part of the crust or atmosphere of a moon or planet. This refractory astrogeological material is also synonymously known as refractory material."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atmospheric_escape rdfs:label "atmospheric escape" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :electromagnetic_radiation ],
        [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom [ owl:intersectionOf ( :gaseous_environmental_material [ a owl:Restriction ;
                                owl:onProperty :part_of ;
                                owl:someValuesFrom :planetary_atmosphere ] ) ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom [ owl:intersectionOf ( :gaseous_environmental_material [ a owl:Restriction ;
                                owl:onProperty :located_in ;
                                owl:someValuesFrom :outer_space ] ) ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :gaseous_environmental_material ],
        :material_transport_process ;
    owl:equivalentClass [ owl:intersectionOf ( :material_transport_process [ a owl:Restriction ;
                        owl:onProperty :has_input ;
                        owl:someValuesFrom [ owl:intersectionOf ( :gaseous_environmental_material [ a owl:Restriction ;
                                            owl:onProperty :part_of ;
                                            owl:someValuesFrom :planetary_atmosphere ] ) ] ] [ a owl:Restriction ;
                        owl:onProperty :has_output ;
                        owl:someValuesFrom [ owl:intersectionOf ( :gaseous_environmental_material [ a owl:Restriction ;
                                            owl:onProperty :located_in ;
                                            owl:someValuesFrom :outer_space ] ) ] ] ) ] ;
    :has_definition "A process during which gases that constitute a planetary atmosphere escape that planet's gravitational field and move away into outer space." .

:electromagnetic_radiation rdfs:label "electromagnetic radiation" .

:has_part rdfs:label "has part" .

:has_participant rdfs:label "has participant" .

:has_input rdfs:label "has input" .

:has_output rdfs:label "has output" .

:located_in rdfs:label "located in" .

:material_transport_process rdfs:label "material transport process" .

:outer_space rdfs:label "outer space" .

:part_of rdfs:label "part of" .

:planetary_atmosphere rdfs:label "planetary atmosphere" .

:gaseous_environmental_material rdfs:label "gaseous environmental material" .

,"Atmospheric escape is a concept that intersects with the material transport process and involves the input of values from the intersection of gaseous environmental material and elements of the planetary atmosphere. It also generates output values from the intersection of gaseous environmental material and elements located in outer space. Atmospheric escape is a subclass of the material transport process and includes components of electromagnetic radiation. It also involves participation from gaseous environmental materials, has input from both gaseous environmental materials and parts of the planetary atmosphere, and generates output related to gaseous materials located in outer space. In essence, atmospheric escape is a process during which gases that constitute a planetary atmosphere escape that planet's gravitational field and move away into outer space."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hydrodynamic_escape rdfs:label "hydrodynamic escape" ;
    rdfs:subClassOf :atmospheric_escape ;
    :has_definition "An atmospheric escape process during which atoms that are parts of a planetary atmosphere escape into outer space through numerous collisions with lighter atoms in that atmosphere." .

:atmospheric_escape rdfs:label "atmospheric escape" .

,"Hydrodynamic escape is a subclass of atmospheric escape, which is defined as an atmospheric escape process during which atoms that are parts of a planetary atmosphere escape into outer space. This process occurs through numerous collisions with lighter atoms in that same atmosphere."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cirrus_homogenitus_cloud rdfs:label "cirrus homogenitus cloud" ;
    rdfs:subClassOf :cirrus_cloud,
        :homogenitus_cloud ;
    :has_definition "A cloud which is cirriform and is formed by condensation events centred on an aircraft's contrail." .

:cirrus_cloud rdfs:label "cirrus cloud" .

:homogenitus_cloud rdfs:label "homogenitus cloud" .

,"The cirrus homogenitus cloud is a subclass of both, the cirrus cloud and the homogenitus cloud. The definition of a cirrus homogenitus cloud is a cirriform cloud that is formed by condensation events centred on an aircraft's contrail."

@prefix : <https://zaitoun.dev/onto/> .
@prefix dc: <http://purl.org/dc/elements/1.1/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cirrus_cloud rdfs:label "cirrus cloud" ;
    dc:contributor <https://orcid.org/0000-0002-2996-719X> ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :filamentous ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:intersectionOf ( :object_aggregate [ a owl:Restriction ;
                                owl:onProperty :has_member ;
                                owl:someValuesFrom :water_ice_crystal ] ) ] ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :high_atmospheric_level ],
        :ice_mass,
        :water_based_cloud ;
    :has_definition "A cloud which 1) has been shaped into detached fibrous filaments, 2) is almost exclusively composed of ice crystals, 3) is located in the high level of the atmosphere (high étage)."@en ;
    :has_exact_synonym "(Eis)-Federwolke"@de,
        "Cirruswolke"@de,
        "Zirruswolke"@de .

:composed_primarily_of rdfs:label "composed primarily of" .

:filamentous rdfs:label "filamentous" .

:has_member rdfs:label "has member" .

:has_quality rdfs:label "has quality" .

:high_atmospheric_level rdfs:label "high atmospheric level" .

:ice_mass rdfs:label "ice mass" .

:object_aggregate rdfs:label "object aggregate" .

:part_of rdfs:label "part of" .

:water_based_cloud rdfs:label "water-based cloud" .

:water_ice_crystal rdfs:label "water ice crystal" .

,"Cirrus cloud is a subclass of various categories including ice mass, water-based cloud, and part of certain values from high atmospheric levels. It also possesses the quality of certain values that are filamentous and is composed primarily of values that intersect with an object aggregate and have members from water ice crystals. The cirrus cloud is defined as a cloud which 1) is shaped into detached fibrous filaments, 2) is almost exclusively composed of ice crystals, and 3) is located in the high level of the atmosphere (high étage). Its contributor can be found via [this link](https://orcid.org/0000-0002-2996-719X). Furthermore, cirrus cloud has exact synonyms including (Eis)-Federwolke, Cirruswolke, and Zirruswolke."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:obsolete_newcloud rdfs:label "obsolete newCloud" ;
    owl:deprecated true ;
    :has_definition "OBSOLETE A cloud which" .

,"The newCloud, which is defined as 'OBSOLETE A cloud', has been deprecated and is currently labeled as true under the obsolete category."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:iucn_strict_nature_reserve rdfs:label "IUCN strict nature reserve" ;
    rdfs:subClassOf :area_protected_according_to_iucn_guidelines ;
    :has_broad_synonym "strict nature reserve" ;
    :has_definition "An IUCN protected area in which human visitation, use and impacts are strictly controlled and limited to ensure protection and conservation of natural biodiversity and/or geodiversity, natural ecosystem assemblages and processes, and any associated cultural and spiritual values." .

:area_protected_according_to_iucn_guidelines rdfs:label "area protected according to IUCN guidelines" .

,"The IUCN strict nature reserve is a subclass of areas protected according to IUCN guidelines. It is defined as an IUCN protected area in which human visitation, use, and impacts are strictly controlled and limited to ensure the protection and conservation of natural biodiversity and/or geodiversity, natural ecosystem assemblages, processes, and any associated cultural and spiritual values. In broader terms, the IUCN strict nature reserve is also known as a strict nature reserve."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:iucn_wilderness_area rdfs:label "IUCN wilderness area" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom [ owl:intersectionOf ( :planetary_surface [ a owl:Restriction ;
                                owl:onProperty :composed_primarily_of ;
                                owl:someValuesFrom :natural_environment ] ) ] ],
        :area_protected_according_to_iucn_guidelines ;
    :has_definition "An IUCN protected area which 1) is dominated by natural ecosystems, 2) is sufficiently large to allow those ecosystems to function and develop without local anthropogenic perturbation, 3) is  managed to prevent perturbations by proximate or local anthropisation, including those caused by local and/or indigenous human communities or human visitation." ;
    :has_exact_synonym "wilderness area" .

:area_protected_according_to_iucn_guidelines rdfs:label "area protected according to IUCN guidelines" .

:composed_primarily_of rdfs:label "composed primarily of" .

:natural_environment rdfs:label "natural environment" .

:overlaps rdfs:label "overlaps" .

:planetary_surface rdfs:label "planetary surface" .

,"An IUCN wilderness area is a subclass of an area that is protected according to IUCN guidelines. This area also overlaps with the intersection of planetary surfaces and composed primarily of certain values from the natural environment. An IUCN wilderness area is defined as an IUCN protected area that 1) is dominated by natural ecosystems, 2) is large enough to allow those ecosystems to function and develop without local anthropogenic perturbation, and 3) is managed to prevent disturbances by proximate or local anthropisation, including those caused by local and/or indigenous human communities or human visitation. An exact synonym for an IUCN wilderness area is a ""wilderness area""."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:geodiversity rdfs:label "geodiversity" ;
    rdfs:subClassOf :physical_object_quality ;
    :has_definition "A quality which inheres in a astronomical body or astronomical body part by virtue of the variation in its material composition, participation in geological processes, and the variation in is land- and hydroforms." .

:physical_object_quality rdfs:label "physical object quality" .

,"The Geodiversity is a subclass of the physical object quality. It is defined as a quality that is inherent to an astronomical body or a part of astronomical body, arising from the variation in its material composition. This also includes its participation in geological processes, and the variation in its land- and hydroforms."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:iucn_natural_monument_or_feature rdfs:label "IUCN natural monument or feature" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :natural_monument ],
        :area_protected_according_to_iucn_guidelines ;
    :has_definition "An IUCN protected area which includes a primarily natural formation designated to be of high natural heritage value and the environmental systems which it determines (e.g. the spray zone of a waterfall monument)." ;
    :has_related_synonym "natural monument" .

:area_protected_according_to_iucn_guidelines rdfs:label "area protected according to IUCN guidelines" .

:natural_monument rdfs:label "natural monument" .

:overlaps rdfs:label "overlaps" .

,"The IUCN natural monument or feature is a sub-class of an area that is protected according to IUCN guidelines, and it simultaneously shares some overlapping values from the natural monument. Defined as an IUCN-protected area, it includes primarily natural formations deemed to have a high natural heritage value and the environmental systems that it determines, as exemplified in the spray zone of a waterfall monument. Moreover, the IUCN natural monument or feature is related synonymously to the natural monument."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:iucn_habitat_species_management_area rdfs:label "IUCN habitat/species management area" ;
    rdfs:subClassOf :area_protected_according_to_iucn_guidelines ;
    :has_broad_synonym "habitat management area" ;
    :has_definition "An IUCN protected area within which the habitats of or ecosystems used by floral and faunal species deemed to be of international, national, or local importance are maintained, conserved, or restored such that their composition and functional integrity are maintained." ;
    :has_related_synonym "species management area" .

:area_protected_according_to_iucn_guidelines rdfs:label "area protected according to IUCN guidelines" .

,"IUCN habitat/species management area is a subclass of areas protected according to IUCN guidelines. It is defined as an IUCN protected area where habitats or ecosystems used by floral and faunal species that are considered to be of international, national, or local importance are maintained, conserved, or restored to maintain their composition and functional integrity. Additionally, a broader synonym for IUCN habitat/species management area is habitat management area. A related synonym for the same is species management area."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ecosystem_fragment rdfs:label "ecosystem fragment" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :ecosystem_fragmentation_process ],
        :ecosystem ;
    :has_definition "An ecosystem which has been causally isolated from a larger ecosystem within which it was previously embedded, such that the direct exchange of materials, resources, and energy between these systems is severely or entirely curtailed." .

:ecosystem rdfs:label "ecosystem" .

:ecosystem_fragmentation_process rdfs:label "ecosystem fragmentation process" .

:formed_as_result_of rdfs:label "formed as result of" .

,"An ecosystem fragment is a sub-class of the ecosystem and is formed as a result of some values from the ecosystem fragmentation process. The definition of an ecosystem fragment is: an ecosystem which has been causally isolated from a larger ecosystem within which it was previously embedded, such that the direct exchange of materials, resources, and energy between these systems is severely or entirely curtailed."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ecosystem_fragmentation_process rdfs:label "ecosystem fragmentation process" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :results_in_formation_of ;
            owl:someValuesFrom :ecosystem_fragment ],
        [ a owl:Restriction ;
            owl:onProperty :causally_upstream_of_or_within ;
            owl:someValuesFrom :ecosystem_decay ],
        [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom :ecosystem ],
        :biological_process,
        :ecosystem_process ;
    owl:equivalentClass [ owl:intersectionOf ( :ecosystem_process [ a owl:Restriction ;
                        owl:onProperty :has_input ;
                        owl:someValuesFrom :ecosystem ] [ a owl:Restriction ;
                        owl:onProperty :results_in_formation_of ;
                        owl:someValuesFrom :ecosystem_fragment ] ) ] ;
    :has_definition "A process during which one or more parts of an ecosystem become causally isolated such that the direct flow or exchange of materials, resources, and energy between a given fragment and the remainder of the original system is severely curtailed or entirely halted." .

:biological_process rdfs:label "biological_process" .

:causally_upstream_of_or_within rdfs:label "causally upstream of or within" .

:ecosystem_decay rdfs:label "ecosystem decay" .

:ecosystem rdfs:label "ecosystem" .

:ecosystem_fragment rdfs:label "ecosystem fragment" .

:ecosystem_process rdfs:label "ecosystem process" .

:has_input rdfs:label "has input" .

:results_in_formation_of rdfs:label "results in formation of" .

,"The ecosystem fragmentation process can be understood as the intersection of the ecosystem process, which involves input from varying aspects of the ecosystem and results in the formation of fragments within the same ecosystem. This fragmentation process is a subclass of several other processes. Firstly, it falls under the ecosystem process itself. Additionally, it is considered a part of the biological process. This process also co-exists as a participating factor in producing inputs for the ecosystem and in creating fragments of the ecosystem. Moreover, the ecosystem fragmentation process is causally upstream of or within the domain of factors contributing to ecosystem decay. The definition that encapsulates the ecosystem fragmentation process is that it's a process during which one or more parts of an ecosystem become causally isolated, causing a severe curtailment or complete halt in the direct flow or exchange of materials, resources, and energy between a given fragment and the remainder of the original system."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_protected_according_to_iucn_guidelines rdfs:label "area protected according to IUCN guidelines" ;
    rdfs:subClassOf :area_of_protected_biodiversity ;
    :alternative_term "IUCN protected area"@en ;
    :has_definition "A protected area in which management objectives have been declared, by a local governing body or authority, to adhere to the guidelines set forth by the International Union for the Conservation of Nature (IUCN)." .

:area_of_protected_biodiversity rdfs:label "area of protected biodiversity" .

,"The area protected according to IUCN guidelines is a sub-class of the area of protected biodiversity. It is defined as a protected area where the management objectives have been declared by a local governing body or authority, so they adhere to guidelines set forth by the International Union for the Conservation of Nature (IUCN). Alternatively, this area can also be termed as the IUCN protected area."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:active_ecosystem_management_process rdfs:label "active ecosystem management process" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :ecosystem ],
        :anthropogenic_environmental_process,
        :anthropogenic_modulatory_intervention_process ;
    :has_definition "A process during which an ecosystem, its parts, or the processes it participates in are modified by human intervention to accomplish an objective." ;
    :has_exact_synonym "ecosystem management" ;
    :has_related_synonym "environmental management",
        "Umweltmaßnahme"@de .

:anthropogenic_environmental_process rdfs:label "anthropogenic environmental process" .

:anthropogenic_modulatory_intervention_process rdfs:label "anthropogenic modulatory intervention process" .

:ecosystem rdfs:label "ecosystem" .

:has_participant rdfs:label "has participant" .

,"The active ecosystem management process is a subclass of both the anthropogenic modulatory intervention process and the anthropogenic environmental process. Additionally, this process participates in, and involves some values from, the ecosystem. The definition of an active ecosystem management process is a process where an ecosystem, its components, or the processes it takes part in are altered by human intervention to achieve a particular objective. It's precisely synonymous with ecosystem management and is related synonymously with Umweltmaßnahme and environmental management."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:conservation_focused_active_ecosystem_management_process rdfs:label "conservation-focused active ecosystem management process" ;
    rdfs:subClassOf :active_ecosystem_management_process ;
    :has_definition "An active management process which has the conservation of an ecosystem, or a part thereof, as its primary objective." ;
    :has_related_synonym "conservation action",
        "conservation process",
        "nature conservation",
        "Umweltschutz"@de .

:active_ecosystem_management_process rdfs:label "active ecosystem management process" .

,"The conservation-focused active ecosystem management process is a subclass of the active ecosystem management process. It is defined as an active management process which prioritizes the conservation of an ecosystem, or part thereof, as its main objective. This process is also known by a few related synonyms such as ""Umweltschutz"", ""conservation action"", ""conservation process"", and ""nature conservation""."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:iucn_protected_landscape_seascape rdfs:label "IUCN protected landscape/seascape" ;
    rdfs:subClassOf :area_protected_according_to_iucn_guidelines ;
    :has_definition "An IUCN protected area which 1) includes entities that have been deemed to be of high scenic quality, 2) is composed of a historically stable assemblage of causally interlinked natural and anthropised ecosystems that provides cultural ecosystem services, and 3) hosts traditional and sustainable human activities." .

:area_protected_according_to_iucn_guidelines rdfs:label "area protected according to IUCN guidelines" .

,"The IUCN protected landscape/seascape is a subclass of an area that is protected according to the guidelines of the IUCN. The definition of an IUCN protected landscape/seascape includes entities that are considered to be of high scenic quality. Furthermore, it consists of a historically stable assembly of causally interlinked natural and human-influenced ecosystems that provide cultural ecosystem services. An IUCN protected landscape/seascape also supports traditional and sustainable human activities."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sacred_site rdfs:label "sacred site" ;
    rdfs:subClassOf :site ;
    :has_definition "A site which is bounded or relativised by a material entity which is of spiritual significance to one or more human groups." .

:site rdfs:label "site" .

,A sacred site is a sub-class of a site. The definition of a sacred site is a location that is bounded or relativised by a material entity and holds spiritual significance to one or more human groups.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ecosystem_decay rdfs:label "ecosystem decay" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :habitat ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :ecological_community ],
        [ a owl:Restriction ;
            owl:onProperty :causally_downstream_of_or_within ;
            owl:someValuesFrom :ecosystem_fragmentation_process ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :ecosystem_fragment ],
        :ecosystem_process ;
    :has_definition "A process during which an ecosystem fragment loses its system integrity, with many of its resident ecological populations 1) losing their habitats, 2) undergoing a loss of functional and phylogenetic diversity, and 3) undergoing a subsequent genetic destabilisation through inbreeding." .

:causally_downstream_of_or_within rdfs:label "causally downstream of or within" .

:ecological_community rdfs:label "ecological community" .

:ecosystem_fragment rdfs:label "ecosystem fragment" .

:ecosystem_fragmentation_process rdfs:label "ecosystem fragmentation process" .

:ecosystem_process rdfs:label "ecosystem process" .

:habitat rdfs:label "habitat" .

:has_participant rdfs:label "has participant" .

,"Ecosystem decay is a subclass of the ecosystem process. It involves participation from various aspects such as habitats, ecosystem fragments, and ecological communities. Ecosystem decay is causally downstream of or within certain values of the ecosystem fragmentation process. The definition of ecosystem decay is a process during which an ecosystem fragment loses its system integrity. This involves many of its resident ecological populations losing their habitats, undergoing a loss of functional and phylogenetic diversity, and experiencing a subsequent genetic destabilisation through inbreeding."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:habitat_fragmentation_process rdfs:label "habitat fragmentation process" ;
    rdfs:subClassOf :ecosystem_fragmentation_process ;
    :has_definition "An ecosystem fragmentation process during which discontinuities emerge in the habitats of one or more ecological populations." .

:ecosystem_fragmentation_process rdfs:label "ecosystem fragmentation process" .

,Habitat fragmentation process is a sub-class of the ecosystem fragmentation process. This process is defined as an ecosystem fragmentation process during which discontinuities emerge in the habitats of one or more ecological populations.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:environment_associated_with_an_aquatic_invertebrate rdfs:label "environment associated with an aquatic invertebrate" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom [ owl:intersectionOf ( [ owl:intersectionOf ( :metazoa [ owl:complementOf :vertebrata__vertebrates_ ] ) ] [ a owl:Restriction ;
                                owl:onProperty :has_habitat ;
                                owl:someValuesFrom [ a owl:Restriction ;
                                        owl:onProperty :overlaps ;
                                        owl:someValuesFrom :aquatic_environment ] ] ) ] ],
        :animal_associated_environment ;
    owl:equivalentClass [ owl:intersectionOf ( :ecosystem [ a owl:Restriction ;
                        owl:onProperty :determined_by ;
                        owl:someValuesFrom [ owl:intersectionOf ( [ owl:intersectionOf ( :metazoa [ owl:complementOf :vertebrata__vertebrates_ ] ) ] [ a owl:Restriction ;
                                            owl:onProperty :has_habitat ;
                                            owl:someValuesFrom [ a owl:Restriction ;
                                                    owl:onProperty :overlaps ;
                                                    owl:someValuesFrom :aquatic_environment ] ] ) ] ] ) ] ;
    :has_definition "An environment which has its properties and composition largely determined by the presence of a metazoan which lacks a vetebral column and which has a habitat that is found in an aquatic environmental system." .

:animal_associated_environment rdfs:label "animal-associated environment" .

:ecosystem rdfs:label "ecosystem" .

:aquatic_environment rdfs:label "aquatic environment" .

:determined_by rdfs:label "determined by" .

:has_habitat rdfs:label "has habitat" .

:metazoa rdfs:label "Metazoa" .

:overlaps rdfs:label "overlaps" .

:vertebrata__vertebrates_ rdfs:label "Vertebrata <vertebrates>" .

,"The environment associated with an aquatic invertebrate is essentially an intersection of the ecosystem and specific values. These values are determined by the overlap of Metazoa and the complement of Vertebrata <vertebrates> in their habitat within an aquatic environment. This environment is not only a subclass of the animal-associated environment but also one that is determined by certain values from the intersection of Metazoa and the complement of Vertebrata <vertebrates>, where the habitat overlaps with the aquatic environment. It is defined as an environment whose properties and composition are largely determined by the presence of a metazoan, which lacks a vertebral column and whose habitat is found in an aquatic environmental system."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arable_land rdfs:label "arable land" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :arable ],
        :land ;
    :has_definition "Land which is regularly manipulated by human activities, such as plowing or tilling, in order to grow crops." .

:arable rdfs:label "arable" .

:has_quality rdfs:label "has quality" .

:land rdfs:label "land" .

,"Arable land is a subclass of land and possesses some qualities that make it arable. The definition of arable land is land which undergoes regular human manipulation, such as plowing or tilling, for the purpose of growing crops."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pasturable_land rdfs:label "pasturable land" ;
    rdfs:subClassOf :land ;
    :has_definition "Land which hosts a community of herbaceous plants - such as grasses and forbs - upon which animals may graze." .

:land rdfs:label "land" .

,"Pasturable land is a sub-class of land. It is defined as a land which hosts a community of herbaceous plants, such as grasses and forbs, upon which animals may graze."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cnidarian_associated_environment rdfs:label "cnidarian-associated environment" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom [ owl:unionOf ( :cnidaria [ a owl:Restriction ;
                                owl:onProperty :part_of ;
                                owl:someValuesFrom :cnidaria ] ) ] ],
        :animal_associated_environment ;
    owl:equivalentClass [ owl:intersectionOf ( :animal_associated_environment [ a owl:Restriction ;
                        owl:onProperty :determined_by ;
                        owl:someValuesFrom [ owl:unionOf ( :cnidaria [ a owl:Restriction ;
                                            owl:onProperty :part_of ;
                                            owl:someValuesFrom :cnidaria ] ) ] ] ) ] ;
    :has_definition "An environmental system determined by a cnidarian or part of a cnidarian." .

:animal_associated_environment rdfs:label "animal-associated environment" .

:determined_by rdfs:label "determined by" .

:part_of rdfs:label "part of" .

:cnidaria rdfs:label "Cnidaria" .

,"The concept of a cnidarian-associated environment is the same as the intersection of an animal-associated environment, determined by certain values from the union of Cnidaria, and a part of some values from Cnidaria. This cnidarian-associated environment is also a subclass of the animal-associated environment and a subclass of the determination influenced by some values from the union of Cnidaria as well as a part of some values from Cnidaria. The definition of a cnidarian-associated environment is an environmental system determined by a cnidarian or a part of a cnidarian."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bondon_cheese_environment rdfs:label "Bondon cheese environment" ;
    rdfs:subClassOf :environmental_system ;
    :has_definition "An environment which has its properties and composition determined by a portion of Bondon cheese." .

:environmental_system rdfs:label "environmental system" .

,The Bondon Cheese Environment is a subcategory of the Environmental System. It is defined as an environment with properties and composition determined from a portion of Bondon cheese.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rhizoplane rdfs:label "rhizoplane" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :rhizosphere ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :plant_matter ],
        :solid_surface_layer ;
    :has_definition "A surface layer which is composed of the external surface of a root, together with closely adhering soil particles and debris" .

:composed_primarily_of rdfs:label "composed primarily of" .

:located_in rdfs:label "located in" .

:plant_matter rdfs:label "plant matter" .

:rhizosphere rdfs:label "rhizosphere" .

:solid_surface_layer rdfs:label "solid surface layer" .

,"Rhizoplane is a subclass of solid surface layer. It is also classified as being located in some values from the rhizosphere. It's primarily composed of some values from plant matter. By definition, Rhizoplane is a surface layer which comprises of the external surface of a root, along with closely adhering soil particles and debris."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tended_pasturable_land rdfs:label "tended pasturable land" ;
    rdfs:subClassOf :pasturable_land ;
    :has_definition "Pasturable land which is maintained by human activities in order to provide grazing oppoturnities for livestock." .

:pasturable_land rdfs:label "pasturable land" .

,Tended pasturable land is a subclass of pasturable land. It is defined as land that is maintained by human activities in order to provide grazing opportunities for livestock.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arable_or_pasturable_land rdfs:label "arable or pasturable land" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:unionOf ( :arable_land :pasturable_land ) ] ],
        :land ;
    owl:equivalentClass [ owl:intersectionOf ( :land [ a owl:Restriction ;
                        owl:onProperty :has_part ;
                        owl:someValuesFrom [ owl:unionOf ( :arable_land :pasturable_land ) ] ] ) ] ;
    :has_definition "Land which either hosts plant communities upon which animals may graze has been manipulated by tilling, ploughing, or other human activity for the purposes of seed sowing or planting crops." .

:arable_land rdfs:label "arable land" .

:has_part rdfs:label "has part" .

:land rdfs:label "land" .

:pasturable_land rdfs:label "pasturable land" .

,"The concept of arable or pasturable land is the same as the intersection of land that contains parts from the amalgamation of arable land and pasturable land. This class of land is not only a subclass of land but also a subclass of areas possessing certain values from the combination of arable land and pasturable land. Arable or pasturable land is defined as land that either hosts plant communities upon which animals may graze, or has been manipulated by tilling, ploughing or other human activity for purposes of seed sowing or planting crops."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arable rdfs:label "arable" ;
    rdfs:subClassOf :environmental_condition ;
    :has_definition "A quality inhereing in a bearer by virtue of the bearer being periodically and mechanically manipulated to loosen and mix any soil which it has as a part." .

:environmental_condition rdfs:label "environmental condition" .

,"Arable, a subclass of environmental conditions, is defined as a quality inhering in a bearer. This quality is a result of the bearer being periodically and mechanically manipulated to loosen and mix any soil which it has as a part."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acidic_soil rdfs:label "acidic soil" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :acidic ],
        :soil ;
    owl:equivalentClass [ owl:intersectionOf ( :soil [ a owl:Restriction ;
                        owl:onProperty :has_quality ;
                        owl:someValuesFrom :acidic ] ) ] ;
    :has_definition "Soil which has increased levels of molecules or ions capable of donating a hydron (proton or hydrogen ion) to other chemical entities, or, alternatively, capable of forming covalent bonds with other chemicals via the acceptance of an electron pair, resulting in a bulk pH measurement of less than 7." .

:acidic rdfs:label "acidic" .

:has_quality rdfs:label "has quality" .

:soil rdfs:label "soil" .

,"The concept of acidic soil is the intersection of soil with certain qualities, some of which are acidic. Acidic soil is a subclass of soil and also a subclass of qualities with acidic values. The definition of acidic soil is a soil that contains increased levels of molecules or ions capable of giving a hydron (proton or hydrogen ion) to other chemical entities, or on the other hand, forming covalent bonds with other chemicals through the acceptance of an electron pair. This results in a bulk pH measurement of less than 7."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acidic_volcanic_ash rdfs:label "acidic volcanic ash" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :acidic ],
        :volcanic_ash ;
    owl:equivalentClass [ owl:intersectionOf ( :volcanic_ash [ a owl:Restriction ;
                        owl:onProperty :has_quality ;
                        owl:someValuesFrom :acidic ] ) ] ;
    :has_definition "Volcanic ash which has increased levels of molecules or ions capable of donating a hydron (proton or hydrogen ion) to other chemical entities, or, alternatively, capable of forming covalent bonds with other chemicals via the acceptance of an electron pair, resulting in a bulk pH measurement of less than 7." .

:acidic rdfs:label "acidic" .

:has_quality rdfs:label "has quality" .

:volcanic_ash rdfs:label "volcanic ash" .

,"The concept of acidic volcanic ash is synonymous with the intersection of volcanic ash and the quality that has some values from acidic. In other words, acidic volcanic ash is a subclass of both volcanic ash and entities that possess a quality with some of its values from acidic. The definition of acidic volcanic ash is understood as volcanic ash which has escalated levels of molecules or ions that are capable of donating a hydron (proton or hydrogen ion) to other chemical entities or forming covalent bonds with other chemicals via the acceptance of an electron pair, resulting in a bulk pH measurement of less than 7."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:holothurian_digestive_tract rdfs:label "holothurian digestive tract" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :holothuroidea ],
        :digestive_tract,
        :environment_associated_with_an_animal_part_or_small_animal ;
    :has_broad_synonym "sea cucumber gut" ;
    :has_definition "A digestive tract environment which has its properties and dynamics determined by the digestive tract of an echinoderm from the class Holothuroidea." ;
    :has_exact_synonym "sea cucumber digestive tract" .

:digestive_tract rdfs:label "digestive tract" .

:environment_associated_with_an_animal_part_or_small_animal rdfs:label "environment associated with an animal part or small animal" .

:holothuroidea rdfs:label "Holothuroidea" .

:part_of rdfs:label "part of" .

,"The holothurian digestive tract is a subclass of the environment associated with an animal part or small animal and is also a subclass of the digestive tract. It is part of some values from Holothuroidea. This means its properties and dynamics are determined by the digestive tract of an echinoderm from the class Holothuroidea. It is also known by its broad synonym, the sea cucumber gut, while its exact synonym is the sea cucumber digestive tract."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:holothurian_digestive_tract_contents rdfs:label "holothurian digestive tract contents" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :holothurian_digestive_tract ],
        :bodily_fluid ;
    owl:equivalentClass [ owl:intersectionOf ( :bodily_fluid [ a owl:Restriction ;
                        owl:onProperty :located_in ;
                        owl:someValuesFrom :holothurian_digestive_tract ] ) ] ;
    :has_definition "A bodily fluid which is present in the digestive tract of a member of the Holothuroidea." .

:bodily_fluid rdfs:label "bodily fluid" .

:holothurian_digestive_tract rdfs:label "holothurian digestive tract" .

:located_in rdfs:label "located in" .

,"The concept of Holothurian Digestive Tract Contents is the same as the intersection of Bodily Fluid and Located in some values from Holothurian Digestive Tract. Moreover, this concept is a sub-class of both Bodily Fluid and Located in some values from Holothurian Digestive Tract. By definition, Holothurian Digestive Tract Contents is a type of bodily fluid that is present in the digestive tract of a member of the Holothuroidea."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:algal_material rdfs:label "algal material" ;
    rdfs:subClassOf :organic_material .

:organic_material rdfs:label "organic material" .

,Algal material is a subclass of organic material.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brown_sea_ice rdfs:label "brown sea ice" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :brown ],
        :sea_ice ;
    owl:equivalentClass [ owl:intersectionOf ( :sea_ice [ a owl:Restriction ;
                        owl:onProperty :has_quality ;
                        owl:someValuesFrom :brown ] ) ] ;
    :has_definition "Sea ice which has a brown colouration, either due to 1) the presence of pigments which are or were contained in the members of ecological assemblages, such as algal communities, living or trapped within the ice or 2) due to the presence of trapped sediments." ;
    :has_exact_synonym "brownish colored sea ice" .

:brown rdfs:label "brown" .

:has_quality rdfs:label "has quality" .

:sea_ice rdfs:label "sea ice" .

,"The brown sea ice concept is the same as the intersection of sea ice and having a quality with some values from brown. This concept is a subclass of sea ice and has the specific quality of bearing some values from brown. The definition of brown sea ice is sea ice that has a brown coloration, either due to the presence of pigments which are or were contained in the members of ecological assemblages, such as algal communities, living or trapped within the ice, or due to the presence of trapped sediments. An exact synonym for brown sea ice is ""brownish-colored sea ice""."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_surface rdfs:label "water surface" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :liquid_water ],
        :aquatic_layer,
        :liquid_surface_layer ;
    owl:equivalentClass [ owl:intersectionOf ( :liquid_surface_layer [ a owl:Restriction ;
                        owl:onProperty :part_of ;
                        owl:someValuesFrom :liquid_water ] ) ] ;
    :has_definition "The surface layer of a volume of water." ;
    :has_exact_synonym "surface of a body of water",
        "water body surface" .

:aquatic_layer rdfs:label "aquatic layer" .

:liquid_surface_layer rdfs:label "liquid surface layer" .

:liquid_water rdfs:label "liquid water" .

:part_of rdfs:label "part of" .

,"The water surface concept is the same as the intersection of the liquid surface layer and part of some values from liquid water. It is a subclass of the aquatic layer, liquid surface layer, and additionally, it is a part of some values from liquid water. The water surface is defined as the surface layer of a volume of water. It has exact synonyms, one being the surface of a body of water and the other being the water body surface."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sediment_surface rdfs:label "sediment surface" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :sediment ],
        :surface_layer ;
    owl:equivalentClass [ owl:intersectionOf ( :surface_layer [ a owl:Restriction ;
                        owl:onProperty :part_of ;
                        owl:someValuesFrom :sediment ] ) ] ;
    :has_definition "The surface layer of a mass of sediment." ;
    :has_exact_synonym "surface of a sedimentary mass",
        "surface sediment" .

:part_of rdfs:label "part of" .

:sediment rdfs:label "sediment" .

:surface_layer rdfs:label "surface layer" .

,"The concept of a sediment surface is the same as the intersection of the surface layer and a part of some values from the sediment. It is identified as a subclass of the surface layer and also as a subclass of the part of some values from the sediment. The definition of a sediment surface is 'The surface layer of a mass of sediment'. It has exact synonyms, specifically 'surface of a sedimentary mass' and 'surface sediment'."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_based_planetary_surface rdfs:label "water-based planetary surface" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf ( :water_surface [ a owl:Restriction ;
                                owl:onProperty :adjacent_to ;
                                owl:someValuesFrom [ owl:unionOf ( :atmosphere :outer_space ) ] ] ) ] ],
        :aquatic_layer,
        :liquid_planetary_surface,
        :liquid_surface_layer ;
    owl:equivalentClass [ owl:intersectionOf ( :liquid_planetary_surface [ a owl:Restriction ;
                        owl:onProperty :composed_primarily_of ;
                        owl:someValuesFrom :liquid_water ] ) ] ;
    :has_related_synonym "A liquid planetary surface which is composed primarily of water." .

:adjacent_to rdfs:label "adjacent to" .

:aquatic_layer rdfs:label "aquatic layer" .

:atmosphere rdfs:label "atmosphere" .

:composed_primarily_of rdfs:label "composed primarily of" .

:has_part rdfs:label "has part" .

:liquid_surface_layer rdfs:label "liquid surface layer" .

:liquid_water rdfs:label "liquid water" .

:outer_space rdfs:label "outer space" .

:water_surface rdfs:label "water surface" .

:liquid_planetary_surface rdfs:label "liquid planetary surface" .

,"The concept of a water-based planetary surface is at the intersection of a liquid planetary surface and the idea of being primarily composed of values from liquid water. As a subclass, the water-based planetary surface falls under aquatic layer, liquid planetary surface, and liquid surface layer. It also forms part of an intersection between water surface and what is adjacent to a union of atmosphere and outer space. A related synonym to this concept is, ""A liquid planetary surface which is composed primarily of water."""

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:magnetosphere rdfs:label "magnetosphere" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_disposition ;
            owl:someValuesFrom :cosmic_ray_shielding_disposition ],
        [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :outer_space ],
        [ a owl:Restriction ;
            owl:onProperty :contains ;
            owl:someValuesFrom :astronomical_body ],
        :environmental_zone ;
    :has_definition "A site in which charged particles are influenced by an astronomical body's magnetic field." .

:astronomical_body rdfs:label "astronomical body" .

:contains rdfs:label "contains" .

:cosmic_ray_shielding_disposition rdfs:label "cosmic ray shielding disposition" .

:environmental_zone rdfs:label "environmental zone" .

:has_disposition rdfs:label "has disposition" .

:outer_space rdfs:label "outer space" .

:overlaps rdfs:label "overlaps" .

,"The magnetosphere is a subclass of the environmental zone and also a site where charged particles are affected by an astronomical body's magnetic field. It possesses the disposition to provide shielding from cosmic rays. Additionally, it contains certain characteristics similar to an astronomical body. Furthermore, it overlaps with aspects of outer space in some areas."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:radiation_shielding_disposition rdfs:label "radiation shielding disposition" ;
    rdfs:subClassOf :environmental_disposition ;
    :has_definition "An environmental disposition which inheres in an entity that intercepts, attenuates, or blocks radiation." .

:environmental_disposition rdfs:label "environmental disposition" .

,"Radiation shielding disposition is a sub-class of environmental disposition. It is defined as an environmental disposition that inheres in an entity, with the ability to intercept, attenuate, or block radiation."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cosmic_ray_shielding_disposition rdfs:label "cosmic ray shielding disposition" ;
    rdfs:subClassOf :radiation_shielding_disposition ;
    :has_definition "A radiation shielding disposition which inheres in a material or immaterial entity which attenuates or blocks cosmic rays." .

:radiation_shielding_disposition rdfs:label "radiation shielding disposition" .

,Cosmic ray shielding disposition is a sub-class of radiation shielding disposition. It is defined as a radiation shielding disposition that exists in a material or immaterial entity that attenuates or blocks cosmic rays.

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:induced_magnetosphere rdfs:label "induced magnetosphere" ;
    rdfs:subClassOf :magnetosphere ;
    :has_definition "A magnetosphere which either 1) cannot withstand the pressure of the stellar wind interacting with it, thus allowing the stellar wind to interact with the ionosphere, atmosphere, or surface of the planet generating it or 2) is formed by the interaction of the stellar wind with an astronomical body unshielded by its own magnetosphere." .

:magnetosphere rdfs:label "magnetosphere" .

,"An induced magnetosphere is a subclass of magnetosphere. The definition of an induced magnetosphere is a magnetosphere which either 1) cannot withstand the pressure of the stellar wind interacting with it, thus allowing the stellar wind to interact with the ionosphere, atmosphere, or surface of the planet generating it or 2) is formed by the interaction of the stellar wind with an astronomical body unshielded by its own magnetosphere."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intrinsic_magnetosphere rdfs:label "intrinsic magnetosphere" ;
    rdfs:subClassOf :magnetosphere ;
    :has_definition "A magnetosphere which shields the body generating it from the stellar wind by withstanding the stellar wind's pressure before it reaches the body." .

:magnetosphere rdfs:label "magnetosphere" .

,The intrinsic magnetosphere is a subclass of the magnetosphere. The definition of the intrinsic magnetosphere is a magnetosphere that shields the body generating it from the stellar wind by withstanding the stellar wind's pressure before it reaches the body.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:terrestrial_environmental_zone rdfs:label "terrestrial environmental zone" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :terrestrial_biome ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :planetary_landmass ],
        :environmental_zone ;
    owl:equivalentClass [ owl:intersectionOf ( :environmental_zone [ a owl:Restriction ;
                        owl:onProperty :part_of ;
                        owl:someValuesFrom :planetary_landmass ] ) ] ;
    :has_definition "An environmental zone which is bounded by material parts of a land mass or the atmosphere or space adjacent to it." .

:terrestrial_biome rdfs:label "terrestrial biome" .

:environmental_zone rdfs:label "environmental zone" .

:planetary_landmass rdfs:label "planetary landmass" .

:part_of rdfs:label "part of" .

,The concept of terrestrial environmental zone is the same as the intersection of environmental zone and part of some values from planetary landmass. It falls under the subclass of environmental zone as well as the part of some values from terrestrial biome and planetary landmass. The definition of a terrestrial environmental zone is an environmental zone which is bounded by material parts of a land mass or the atmosphere or space adjacent to it.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anthropised_terrestrial_environmental_zone rdfs:label "anthropised terrestrial environmental zone" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :anthropogenic_terrestrial_biome ],
        :terrestrial_environmental_zone ;
    owl:equivalentClass [ owl:intersectionOf ( :terrestrial_environmental_zone [ a owl:Restriction ;
                        owl:onProperty :part_of ;
                        owl:someValuesFrom :anthropogenic_terrestrial_biome ] ) ] ;
    :has_definition "A terrestrial zone which is bounded by constructed, manufactured, or other anthropogenic material entities." .

:anthropogenic_terrestrial_biome rdfs:label "anthropogenic terrestrial biome" .

:part_of rdfs:label "part of" .

:terrestrial_environmental_zone rdfs:label "terrestrial environmental zone" .

,"The anthropised terrestrial environmental zone is a concept that is identical to the intersection of terrestrial environmental zone and a part of some values from the anthropogenic terrestrial biome. It is considered a subclass of the terrestrial environmental zone as well as a subclass of a part of some values from the anthropogenic terrestrial biome. The definition of an anthropised terrestrial environmental zone is a terrestrial zone that is bounded by constructed, manufactured, or other anthropogenic material entities."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:marine_environmental_zone rdfs:label "marine environmental zone" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :marine_environment ],
        :environmental_zone ;
    owl:equivalentClass [ owl:intersectionOf ( :environmental_zone [ a owl:Restriction ;
                        owl:onProperty :part_of ;
                        owl:someValuesFrom :marine_environment ] ) ] ;
    :has_definition "An environmental zone which is bounded by material parts of a marine environment." .

:environmental_zone rdfs:label "environmental zone" .

:marine_environment rdfs:label "marine environment" .

:part_of rdfs:label "part of" .

,"The concept of marine environmental zone is the same as the intersection of environmental zone and part of some values from the marine environment. It is a subclass of both, the environmental zone and part of some values from the marine environment. This definition of the marine environmental zone lies in being an environmental zone that is bounded by material parts of a marine environment."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alluvium rdfs:label "alluvium" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :porous ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :granular ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:unionOf ( :alluvial_soil :alluvial_sediment ) ] ],
        :environmental_material ;
    :has_definition "Soil or sediment which has been eroded and influenced by flowing water and redeposited in a non-marine setting." .

:alluvial_sediment rdfs:label "alluvial sediment" .

:alluvial_soil rdfs:label "alluvial soil" .

:composed_primarily_of rdfs:label "composed primarily of" .

:environmental_material rdfs:label "environmental material" .

:granular rdfs:label "granular" .

:porous rdfs:label "porous" .

:has_quality rdfs:label "has quality" .

,"Alluvium, a subclass of environmental material, possesses certain qualities, some of which include being porous and granular. It is primarily composed of a mixture of alluvial soil and alluvial sediment. By definition, Alluvium refers to soil or sediment that has been eroded, influenced by flowing water, and redeposited in a non-marine setting."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alluvial_sediment rdfs:label "alluvial sediment" ;
    rdfs:subClassOf :sediment ;
    :has_definition "Sediment which has been transported by flowing water and redeposited in a non-marine setting." .

:sediment rdfs:label "sediment" .

,"Alluvial sediment, a subclass of sediment, is defined as sediment that has been transported by flowing water and redeposited in a non-marine setting."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alluvial_deposit rdfs:label "alluvial deposit" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:unionOf ( :alluvial_soil :alluvial_sediment ) ] ],
        [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :lithification ],
        :rock ;
    :has_definition "A rock which is formed as a result of the lithification of alluvium." .

:alluvial_sediment rdfs:label "alluvial sediment" .

:alluvial_soil rdfs:label "alluvial soil" .

:composed_primarily_of rdfs:label "composed primarily of" .

:formed_as_result_of rdfs:label "formed as result of" .

:lithification rdfs:label "lithification" .

:rock rdfs:label "rock" .

,"Alluvial deposit is a subclass of rock, which is formed as a result of some values from lithification. It is composed primarily of some values from the union of alluvial soil and alluvial sediment. Furthermore, the definition of alluvial deposit is a rock which is formed as a result of the lithification of alluvium."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lithification rdfs:label "lithification" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom :sediment ],
        [ a owl:Restriction ;
            owl:onProperty :results_in_formation_of ;
            owl:someValuesFrom :sedimentary_rock ],
        :biological_process,
        :material_transformation_process ;
    owl:equivalentClass [ owl:intersectionOf ( :material_transformation_process [ a owl:Restriction ;
                        owl:onProperty :has_input ;
                        owl:someValuesFrom :sediment ] [ a owl:Restriction ;
                        owl:onProperty :results_in_formation_of ;
                        owl:someValuesFrom :sedimentary_rock ] ) ] ;
    :has_definition "A process during which sediments compact under pressure, expel connate fluids, and gradually become solid sedimentary rock." .

:biological_process rdfs:label "biological_process" .

:has_input rdfs:label "has input" .

:material_transformation_process rdfs:label "material transformation process" .

:results_in_formation_of rdfs:label "results in formation of" .

:sediment rdfs:label "sediment" .

:sedimentary_rock rdfs:label "sedimentary rock" .

,"Lithification is a concept that intersects with the material transformation process, where it takes input from certain sediment values, and results in the formation of sedimentary rock. It is subclass of various processes such as the material transformation process, biological process, and is involved in the input of specific sediment values and formation of sedimentary rock values. The process of Lithification is defined as the process during which sediments compact under pressure, expel connate fluids, and gradually become a solid sedimentary rock."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:grassland_ecosystem rdfs:label "grassland ecosystem" ;
    rdfs:subClassOf :terrestrial_ecosystem ;
    :has_definition "An ecosystem in which grasses (Graminae) are the dominant form of vegetation and determine the system's structure and dynamics."^^xsd:string ;
    :has_exact_synonym "GRASSLAND"^^xsd:string,
        "grassland"^^xsd:string ;
    :has_related_synonym "Grassland"^^xsd:string,
        "down"^^xsd:string,
        "downland"^^xsd:string,
        "downs"^^xsd:string,
        "glade"^^xsd:string,
        "grazing area"^^xsd:string,
        "herbaceous area"^^xsd:string .

:terrestrial_ecosystem rdfs:label "terrestrial ecosystem" .

,"The grassland ecosystem is a subclass of the terrestrial ecosystem. This is an ecosystem where grasses (Graminae) chiefly forms the vegetation and governs the system's structure and dynamics, hence being defined as such. It has exact synonyms, such as 'GRASSLAND' and 'grassland'. Moreover, the grassland ecosystem is also related to several synonyms such as 'Grassland', 'down', 'downland', 'downs', 'glade', 'grazing area', and 'herbaceous area'."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ranch rdfs:label "ranch" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :rangeland_biome ],
        :farm ;
    :has_definition "An area of land used for the herding and grazing of livestock."^^xsd:string ;
    :has_related_synonym "ranch"^^xsd:string .

:farm rdfs:label "farm" .

:part_of rdfs:label "part of" .

:rangeland_biome rdfs:label "rangeland biome" .

,"A ranch is a subclass of a farm and can also be considered a part of some values from the rangeland biome. The ranch's definition is an area of land used for the herding and grazing of livestock. Furthermore, ""ranch"" can also be a related synonym for a ranch."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:swamp_area rdfs:label "swamp area" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :swamp_ecosystem ],
        :wetland_area ;
    :has_definition "An area of wetland which overlaps a swamp ecosystem."^^xsd:string .

:overlaps rdfs:label "overlaps" .

:swamp_ecosystem rdfs:label "swamp ecosystem" .

:wetland_area rdfs:label "wetland area" .

,The swamp area is a subclass of the wetland area and partially overlaps with the swamp ecosystem. It's defined as an area of wetland which overlaps a swamp ecosystem.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:defence_against_flooding rdfs:label "defence against flooding" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :negatively_regulates ;
            owl:someValuesFrom :flooding ],
        :anthropogenic_modulatory_intervention_process ;
    owl:equivalentClass [ owl:intersectionOf ( :anthropogenic_modulatory_intervention_process [ a owl:Restriction ;
                        owl:onProperty :negatively_regulates ;
                        owl:someValuesFrom :flooding ] ) ] ;
    :has_definition "A planned process during which an environmental system is modified to mitigate or nullify the impacts of flooding." ;
    :has_exact_synonym "defense against flooding" ;
    :has_related_synonym "defence against floods",
        "defense against floods",
        "flood defence",
        "flood defence intervention",
        "flood defense",
        "flood defense intervention" .

:anthropogenic_modulatory_intervention_process rdfs:label "anthropogenic modulatory intervention process" .

:flooding rdfs:label "flooding" .

:negatively_regulates rdfs:label "negatively regulates" .

,"The concept of defence against flooding is the intersection of anthropogenic modulatory intervention process and the process that negatively regulates some values from flooding. As a subclass of both the anthropogenic modulatory intervention process and the regulation process, defence against flooding is a planned strategy during which an environmental system is modified to mitigate or nullify the impacts of flooding. The exact synonym for this concept is ""defense against flooding"", while related synonyms include ""defence against floods"", ""defense against floods"", ""flood defence"", ""flood defence intervention"", ""flood defense"", and ""flood defense intervention""."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:stellar_radiation rdfs:label "stellar radiation" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :process_has_causal_agent ;
            owl:someValuesFrom :star ],
        :electromagnetic_radiation ;
    owl:equivalentClass [ owl:intersectionOf ( :electromagnetic_radiation [ a owl:Restriction ;
                        owl:onProperty :process_has_causal_agent ;
                        owl:someValuesFrom :star ] ) ] ;
    :has_definition "An electromagnetic radiation process during which electromagnetic waves or their quanta are emitted from a star." ;
    :has_narrow_synonym "solar radiation" .

:electromagnetic_radiation rdfs:label "electromagnetic radiation" .

:process_has_causal_agent rdfs:label "process has causal agent" .

:star rdfs:label "star" .

,"The concept of stellar radiation is the same as the intersection of electromagnetic radiation and the process that has some values from a star as its causal agent. Stellar radiation is classified as a subclass of both electromagnetic radiation and the process that holds some values from a star as its causal agent. By definition, stellar radiation is an electromagnetic radiation process during which electromagnetic waves or their quanta are emitted from a star. A narrower synonym for stellar radiation is solar radiation."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:microwave_stellar_radiation rdfs:label "microwave stellar radiation" ;
    rdfs:subClassOf :microwave_radiation,
        :stellar_radiation ;
    owl:equivalentClass [ owl:intersectionOf ( :microwave_radiation [ a owl:Restriction ;
                        owl:onProperty :process_has_causal_agent ;
                        owl:someValuesFrom :star ] ) ] ;
    :has_definition "A stellar radiation process during which electromagnetic waves or their quanta are emitted from a star at wavelengths and frequencies which travel exclusively in a line-of-sight fashion and which may produce molecular rotation and torsion on contact with matter." ;
    :has_narrow_synonym "microwave solar radiation" .

:process_has_causal_agent rdfs:label "process has causal agent" .

:star rdfs:label "star" .

:stellar_radiation rdfs:label "stellar radiation" .

:microwave_radiation rdfs:label "microwave radiation" .

,"Microwave stellar radiation is a concept that intersects the microwave radiation process, and has causal agents that derive some values from stars. It is a subclass of both stellar radiation and microwave radiation. Microwave stellar radiation is defined as a stellar radiation process during which electromagnetic waves or their quanta are emitted from a star at wavelengths and frequencies that travel exclusively in a line-of-sight fashion and may produce molecular rotation and torsion upon contact with matter. The term microwave stellar radiation can also be narrowly synonymous with microwave solar radiation."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:radio_wave_stellar_radiation rdfs:label "radio wave stellar radiation" ;
    rdfs:subClassOf :radio_wave_radiation,
        :stellar_radiation ;
    owl:equivalentClass [ owl:intersectionOf ( :radio_wave_radiation [ a owl:Restriction ;
                        owl:onProperty :process_has_causal_agent ;
                        owl:someValuesFrom :star ] ) ] ;
    :has_definition "A stellar radiation process during which electromagnetic waves or their quanta are emitted from a star at wavelengths ranging from millimetre to kilometer scales." ;
    :has_narrow_synonym "radio wave solar radiation" .

:process_has_causal_agent rdfs:label "process has causal agent" .

:star rdfs:label "star" .

:stellar_radiation rdfs:label "stellar radiation" .

:radio_wave_radiation rdfs:label "radio wave radiation" .

,"The concept of radio wave stellar radiation is similar to that of the intersection of radio wave radiation, in which the process has some star values as a causal agent. Radio wave stellar radiation is a subclass of both stellar radiation and radio wave radiation. It is defined as a stellar radiation process during which electromagnetic waves or their quanta are emitted from a star at wavelengths ranging from millimetre to kilometer scales. A narrower synonym for radio wave stellar radiation would be radio wave solar radiation."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:infrared_stellar_radiation rdfs:label "infrared stellar radiation" ;
    rdfs:subClassOf :infrared_radiation,
        :stellar_radiation ;
    owl:equivalentClass [ owl:intersectionOf ( :infrared_radiation [ a owl:Restriction ;
                        owl:onProperty :process_has_causal_agent ;
                        owl:someValuesFrom :star ] ) ] ;
    :has_broad_synonym "infrared radiation" ;
    :has_definition "A stellar radiation process during which electromagnetic waves or their quanta are emitted from a star when molecules change their rotational-vibrational movements, usually at wavelengths between 760 nm and 1 mm." ;
    :has_exact_synonym "infra-red stellar radiation" ;
    :has_narrow_synonym "infrared solar radiation" ;
    :has_related_synonym "IR stellar radiation" .

:process_has_causal_agent rdfs:label "process has causal agent" .

:star rdfs:label "star" .

:stellar_radiation rdfs:label "stellar radiation" .

:infrared_radiation rdfs:label "infrared radiation" .

,"Infrared stellar radiation, a subclass of both stellar radiation and infrared radiation, is conceptually the same as the intersection of infrared radiation, and a process that has some sort of causal agent values from a star. This process is defined as the emission of electromagnetic waves or their quanta from a star when molecules change their rotational-vibrational movements, usually at wavelengths between 760 nm and 1 mm. This concept is broadly referred to as infrared radiation, specifically denoted as ""infra-red stellar radiation."" Moreover, a narrower term for it is ""infrared solar radiation,"" while it is also related to ""IR stellar radiation."""

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:visible_spectrum_stellar_radiation rdfs:label "visible spectrum stellar radiation" ;
    rdfs:subClassOf :stellar_radiation,
        :visible_spectrum_radiation ;
    owl:equivalentClass [ owl:intersectionOf ( :visible_spectrum_radiation [ a owl:Restriction ;
                        owl:onProperty :process_has_causal_agent ;
                        owl:someValuesFrom :star ] ) ] ;
    :has_definition "A stellar radiation process during which electromagnetic waves or their quanta are emitted from a star at wavelengths between 380 nm and 760 nm." ;
    :has_exact_synonym "optical stellar radiation" ;
    :has_narrow_synonym "visible spectrum solar radiation" .

:process_has_causal_agent rdfs:label "process has causal agent" .

:star rdfs:label "star" .

:stellar_radiation rdfs:label "stellar radiation" .

:visible_spectrum_radiation rdfs:label "visible spectrum radiation" .

,The concept of visible spectrum stellar radiation is the same as the intersection of the radiation in the visible spectrum and the process that star enacts as a causal agent. It is a subclass of both stellar radiation and visible spectrum radiation. The visible spectrum stellar radiation is defined as a stellar radiation process during which electromagnetic waves or their quanta are emitted from a star at wavelengths between 380 nm and 760 nm. There are synonymous terms for visible spectrum stellar radiation. It's exactly synonymous with optical stellar radiation and specifically or narrowly synonymous with visible spectrum solar radiation.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ultraviolet_stellar_radiation rdfs:label "ultraviolet stellar radiation" ;
    rdfs:subClassOf :stellar_radiation,
        :ultraviolet_radiation ;
    owl:equivalentClass [ owl:intersectionOf ( :ultraviolet_radiation [ a owl:Restriction ;
                        owl:onProperty :process_has_causal_agent ;
                        owl:someValuesFrom :star ] ) ] ;
    :has_definition "A stellar radiation process during which electromagnetic waves or their quanta are emitted from a star at wavelengths between 10 nm and 400 nm." ;
    :has_narrow_synonym "ultraviolet solar radiation" .

:process_has_causal_agent rdfs:label "process has causal agent" .

:star rdfs:label "star" .

:stellar_radiation rdfs:label "stellar radiation" .

:ultraviolet_radiation rdfs:label "ultraviolet radiation" .

,"The concept of ultraviolet stellar radiation is similar to the intersection of ultraviolet radiation and some process which has causal agents from a star. It falls under the broader categories of both stellar radiation and ultraviolet radiation. Ultraviolet stellar radiation is defined as a type of stellar radiation process during which electromagnetic waves or their quanta are emitted from a star at wavelengths between 10 nm and 400 nm. An alternative, more specific term for it is ultraviolet solar radiation."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:x_ray_stellar_radiation rdfs:label "X-ray stellar radiation" ;
    rdfs:subClassOf :ionizing_stellar_radiation,
        :x_ray_radiation ;
    owl:equivalentClass [ owl:intersectionOf ( :x_ray_radiation [ a owl:Restriction ;
                        owl:onProperty :process_has_causal_agent ;
                        owl:someValuesFrom :star ] ) ] ;
    :has_definition "A stellar radiation process during which penetrating electromagnetic radiation is emitted by high-energy electrons as they fall into a lower state of energy." ;
    :has_exact_synonym "x ray stellar radiation" ;
    :has_narrow_synonym "X-ray solar radiation" .

:ionizing_stellar_radiation rdfs:label "ionizing stellar radiation" .

:process_has_causal_agent rdfs:label "process has causal agent" .

:star rdfs:label "star" .

:x_ray_radiation rdfs:label "X-ray radiation" .

,"The concept of X-ray stellar radiation is similar to the intersection of the X-ray radiation process and the causal agent associated with stars. X-ray stellar radiation falls under the subclasses of ionizing stellar radiation and X-ray radiation. It defined as a stellar radiation process during which penetrating electromagnetic radiation is emitted by high-energy electrons as they fall into a lower energy state. This term is also known as 'X-ray stellar radiation' and has a more specific synonym, 'X-ray solar radiation'."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gamma_ray_stellar_radiation rdfs:label "gamma-ray stellar radiation" ;
    rdfs:subClassOf :gamma_ray_radiation,
        :ionizing_stellar_radiation ;
    owl:equivalentClass [ owl:intersectionOf ( :gamma_ray_radiation [ a owl:Restriction ;
                        owl:onProperty :process_has_causal_agent ;
                        owl:someValuesFrom :star ] ) ] ;
    :has_definition "A stellar radiation process during which penetrating electromagnetic radiation is emitted from the radioactive decay (gamma decay) of atomic nuclei." ;
    :has_narrow_synonym "gamma-ray solar radiation" .

:ionizing_stellar_radiation rdfs:label "ionizing stellar radiation" .

:process_has_causal_agent rdfs:label "process has causal agent" .

:star rdfs:label "star" .

:gamma_ray_radiation rdfs:label "gamma-ray radiation" .

,"The concept of gamma-ray stellar radiation is the same as the intersection of gamma-ray radiation and a process that has a causal agent which obtains some values from a star. This gamma-ray stellar radiation is a subclass of both ionizing stellar radiation and gamma-ray radiation. Essentially, gamma-ray stellar radiation is a stellar radiation process where penetrating electromagnetic radiation is emitted from the radioactive decay (gamma decay) of atomic nuclei. It's also narrowly synonymous with gamma-ray solar radiation."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ionizing_stellar_radiation rdfs:label "ionizing stellar radiation" ;
    rdfs:subClassOf :ionizing_radiation,
        :stellar_radiation ;
    owl:equivalentClass [ owl:intersectionOf ( :ionizing_radiation [ a owl:Restriction ;
                        owl:onProperty :process_has_causal_agent ;
                        owl:someValuesFrom :star ] ) ] ;
    :has_definition "A stellar radiation process during which electromagnetic waves or their quanta are emitted from a star with sufficient energy to disrupt molecular bonds or alter the electron number of atoms." ;
    :has_exact_synonym "ionising stellar radiation" ;
    :has_narrow_synonym "ionising solar radiation" .

:process_has_causal_agent rdfs:label "process has causal agent" .

:star rdfs:label "star" .

:stellar_radiation rdfs:label "stellar radiation" .

:ionizing_radiation rdfs:label "ionizing radiation" .

,"The concept of Ionizing Stellar Radiation is the intersection of Ionizing Radiation and a process that has some values originating from a star. This concept is a sub-class of both Stellar Radiation and Ionizing Radiation. Ionizing Stellar Radiation is defined as a process of stellar radiation during which electromagnetic waves, or their quanta, are emitted from a star with sufficient energy to disrupt molecular bonds or alter the number of electrons in atoms. The exact synonym for Ionizing Stellar Radiation is Ionising Stellar Radiation, and it has a narrower synonym known as Ionising Solar Radiation."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_accumulation_process rdfs:label "water accumulation process" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :water_body ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :liquid_water ],
        :hydrological_process,
        :liquid_accumulation_process ;
    :has_definition "A process during which liquid water accumulates in a site, most often in some form of container." .

:has_output rdfs:label "has output" .

:has_participant rdfs:label "has participant" .

:hydrological_process rdfs:label "hydrological process" .

:liquid_accumulation_process rdfs:label "liquid accumulation process" .

:liquid_water rdfs:label "liquid water" .

:water_body rdfs:label "water body" .

,"The water accumulation process is a subclass of the liquid accumulation process, and also a subclass of the hydrological process. It is further characterized by having participants that include some values from liquid water. The output of this process includes some values from the water body. The water accumulation process is defined as a process during which liquid water accumulates in a site, most often in some form of container."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:office_building rdfs:label "office building" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :toilet_fixture ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :office ],
        :commercial_building ;
    :has_definition "A commercial building which contains parts used as workplaces primarily for administrative and managerial workers." .

:commercial_building rdfs:label "commercial building" .

:office rdfs:label "office" .

:toilet_fixture rdfs:label "toilet fixture" .

:has_part rdfs:label "has part" .

,"An office building is a subclass of a commercial building and it also has some values for toilet fixtures and offices as its parts. By definition, an office building is a commercial building specifically designed to contain parts used primarily as workplaces for administrative and managerial workers."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:commercial_building rdfs:label "commercial building" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :participates_in ;
            owl:someValuesFrom :usage_of_an_environment_for_business ],
        :building ;
    owl:equivalentClass [ owl:intersectionOf ( :building [ a owl:Restriction ;
                        owl:onProperty :participates_in ;
                        owl:someValuesFrom :usage_of_an_environment_for_business ] ) ] ;
    :has_definition "A building which is primarily used to facilitate the buying or selling of goods or services." .

:building rdfs:label "building" .

:participates_in rdfs:label "participates in" .

:usage_of_an_environment_for_business rdfs:label "usage of an environment for business" .

,"The concept of a commercial building is understood as the intersection of a building that participates in some values linked with the usage of an environment for business. This suggests a commercial building is a sub-class of a building, as well as, it classifies under those structures that take part in certain ways with the usage of an environment for business purposes. Essentially, a commercial building is defined as a building predominantly used to facilitate the buying or selling of goods or services."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lumber_production_process rdfs:label "lumber production process" ;
    rdfs:subClassOf :planetary_manufacturing_process ;
    :has_definition "A process during which wood is processed into beams or planks." ;
    :has_exact_synonym "lumber production",
        "timber production",
        "timber production process" .

:planetary_manufacturing_process rdfs:label "planetary manufacturing process" .

,"The lumber production process is a subclass of the planetary manufacturing process. This process is defined as one during which wood is processed into beams or planks. Furthermore, lumber production process has exact synonyms such as lumber production, timber production, and timber production process."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:office rdfs:label "office" ;
    rdfs:subClassOf :building_part ;
    :has_definition "A building part within which administrative work is done by an organisations users in order to support and realise the objectives of that organization." .

:building_part rdfs:label "building part" .

,An office is a subclass of a building part. It is defined as a part within a building where administrative work is done by the users of an organization in order to support and realize the objectives of that organization.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:iucn_protected_area_with_sustainable_use_of_natural_resources rdfs:label "IUCN protected area with sustainable use of natural resources" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom [ owl:intersectionOf ( :planetary_surface [ a owl:Restriction ;
                                owl:onProperty :composed_primarily_of ;
                                owl:someValuesFrom :natural_environment ] ) ] ],
        :area_protected_according_to_iucn_guidelines ;
    :has_broad_synonym "protected area with sustainable use of natural resources" ;
    :has_definition "An IUCN protected area within which 1) natural ecosystems and their resources are either conserved or used through non-industrial human activities, 2) usage activites contribute to conservation goals, ensuring inter-generational security for local communities' livelihoods, and 3) the majority of benefits derived from the use of ecosystems are received by communities living near or in the area." .

:area_protected_according_to_iucn_guidelines rdfs:label "area protected according to IUCN guidelines" .

:composed_primarily_of rdfs:label "composed primarily of" .

:natural_environment rdfs:label "natural environment" .

:overlaps rdfs:label "overlaps" .

:planetary_surface rdfs:label "planetary surface" .

,"The IUCN protected area with sustainable use of natural resources is a subclass under the area protected according to IUCN guidelines. Additionally, it also overlaps some values from the intersection of the planetary surface and is composed primarily of some values from the natural environment. This IUCN protected area is defined as an area within which 1) natural ecosystems and their resources are conserved or used through non-industrial human activities, 2) usage activities contribute to the conservation goals, ensuring inter-generational security for local communities' livelihoods, and 3) the majority of benefits derived from the use of ecosystems are received by the communities living near or within the area. Another term broadly synonymous with the IUCN protected area with sustainable use of natural resources is 'protected area with sustainable use of natural resources'."

@prefix : <https://zaitoun.dev/onto/> .
