@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:terrestrial_natural_environment rdfs:label "terrestrial natural environment" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :planetary_landmass ],
        :natural_environment ;
    owl:equivalentClass [ owl:intersectionOf ( :natural_environment [ a owl:Restriction ;
                        owl:onProperty :part_of ;
                        owl:someValuesFrom :planetary_landmass ] ) ] ;
    :has_definition "A natural environment which is located on a land mass." .

:natural_environment rdfs:label "natural environment" .

:part_of rdfs:label "part of" .

:planetary_landmass rdfs:label "planetary landmass" .

,"The terrestrial natural environment concept is the same as the intersection of the natural environment and a part of some values from the planetary landmass. Furthermore, the terrestrial natural environment is a subclass of both the natural environment and a part of some values from the planetary landmass. By definition, the terrestrial natural environment is a natural environment located on a land mass."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
