:aquatic_natural_environment rdfs:label "aquatic natural environment" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :water_body ],
        :natural_environment ;
    owl:equivalentClass [ owl:intersectionOf ( :natural_environment [ a owl:Restriction ;
                        owl:onProperty :part_of ;
                        owl:someValuesFrom :water_body ] ) ] ;
    :has_definition "A natural environment which is within a water body." .

:natural_environment rdfs:label "natural environment" .

:part_of rdfs:label "part of" .

:water_body rdfs:label "water body" .

,"The concept of aquatic natural environment is the same as the intersection of natural environment and comprises some values from the water body. The aquatic natural environment is also a subclass of the natural environment, and a subclass of some values derived from the water body. By definition, an aquatic natural environment is a natural environment that exists within a water body."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hill_sphere rdfs:label "Hill sphere" ;
    rdfs:subClassOf [ owl:intersectionOf ( [ a owl:Restriction ;
                        owl:onProperty :contains_process ;
                        owl:someValuesFrom :gravitational_motion ] [ a owl:Restriction ;
                        owl:onProperty :process_has_causal_agent ;
                        owl:someValuesFrom :astronomical_body ] ) ],
        [ a owl:Restriction ;
            owl:onProperty :contains ;
            owl:someValuesFrom :astronomical_body ],
        :environmental_zone ;
    :has_definition "A site in which the attraction of satellites by gravitation is dominated by an astronomical body, bounded by a zero-velocity surface." ;
    :has_exact_synonym "Roche sphere" .

:contains rdfs:label "contains" .

:contains_process rdfs:label "contains process" .

:environmental_zone rdfs:label "environmental zone" .

:gravitational_motion rdfs:label "gravitational motion" .

:process_has_causal_agent rdfs:label "process has causal agent" .

:astronomical_body rdfs:label "astronomical body" .

,"The Hill sphere is a sub-class of the environmental zone and an intersection that contains processes driven by gravitational motion and processes governed by an astronomical body. Moreover, the Hill sphere carries certain values from the astronomical body. It is defined as a site where the gravitational attraction of satellites is dominated by an astronomical body, bounded by a zero-velocity surface. The Hill sphere also has an exact synonym, called the Roche sphere."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:lagrangian_point rdfs:label "Lagrangian point" ;
    rdfs:subClassOf [ owl:minQualifiedCardinality "2"^^xsd:nonNegativeInteger ;
            owl:onClass :hill_sphere ;
            owl:onProperty :has_component ],
        [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :hill_sphere ],
        :environmental_zone ;
    :has_definition "A site in which the combined gravitational pull of the two large astronomical bodies is such that a smaller body, affected only by gravity, can maintain a stable position relative to those two large bodies and orbit with them due to centripetal force." ;
    :has_exact_synonym "L-points",
        "Lagrange points",
        "libration points" .

:environmental_zone rdfs:label "environmental zone" .

:has_component rdfs:label "has component" .

:overlaps rdfs:label "overlaps" .

:hill_sphere rdfs:label "Hill sphere" .

,"Lagrangian point is a sub-class of the environmental zone, and overlaps with some values from the Hill sphere. On the property, it has a minimum qualified cardinality of 2 and is also a part of the class, Hill sphere.

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tropical_marginal_sea_biome rdfs:label "tropical marginal sea biome" ;
    rdfs:subClassOf :marginal_sea_biome,
