:marginal_sea_biome rdfs:label "marginal sea biome" .

:tropical_biome rdfs:label "tropical biome" .

,The tropical marginal sea biome is a subclass of both the marginal sea biome and the tropical biome. It is defined as a marginal sea biome located in a region with a tropical climate.

@prefix : <https://zaitoun.dev/onto/> .
