:sapropelic_kerogen rdfs:label "sapropelic kerogen" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_into ;
            owl:someValuesFrom [ owl:intersectionOf ( :hydrocarbon [ a owl:Restriction ;
                                owl:onProperty :has_quality ;
                                owl:someValuesFrom :quality_of_a_liquid ] ) ] ],
        :kerogen ;
    :has_definition "Kerogen which cotains alginite, amorphous organic matter, cyanobacteria, freshwater algae, and land plant resins, thus having a hydrogen to carbon ratio above 1.25, and oxygen to carbon ratio below 0.15, readily produces liquid hydrocarbons, has reduced concentrations of aromatic structures, and primarily derived from proteins and lipids." .

:derives_into rdfs:label "derives into" .

:has_quality rdfs:label "has quality" .

:hydrocarbon rdfs:label "hydrocarbon" .

:kerogen rdfs:label "kerogen" .

:quality_of_a_liquid rdfs:label "quality of a liquid" .

,"Sapropelic kerogen, a sub-class of kerogen, consists of alginite, amorphous organic matter, cyanobacteria, freshwater algae, and land plant resins. It typically has a hydrogen to carbon ratio above 1.25 and an oxygen to carbon ratio below 0.15. Because of these ratios, sapropelic kerogen readily produces liquid hydrocarbons, has lesser concentrations of aromatic structures, and is primarily derived from proteins and lipids. Additionally, sapropelic kerogen derives some of its values from the intersection of hydrocarbons and exhibits certain qualities associated with the nature of a liquid."

@prefix : <https://zaitoun.dev/onto/> .
