:kerogen rdfs:label "kerogen" .

:petroleum rdfs:label "petroleum" .

,"Labile Kerogen is a sub class of Kerogen, which is defined as Kerogen from which heavy hydrocarbons, such as oils, are derived following chemical breakdown. Moreover, this subclass can derive some values from petroleum."

@prefix : <https://zaitoun.dev/onto/> .
