:planktonic_kerogen rdfs:label "planktonic kerogen" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty <http://purl.obolibrary.org/obo/envo#has_increased_levels_of> ;
            owl:someValuesFrom :sulfur_molecular_entity ],
        [ a owl:Restriction ;
            owl:onProperty :derives_into ;
            owl:someValuesFrom [ owl:intersectionOf ( :petroleum :hydrocarbon_gas ) ] ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :planktonic_material ],
        :kerogen ;
    :has_definition "Kerogen which is enriched in sulfur compounds, has a hydrogen to carbon ratio under 1.25, an oxygen to carbon ratio between 0.03 and 0.18, derives into mixtures of hydrocarbon gas and oil, and derives from marine organic materials (primarily lipids) which are formed in reducing environments." .

:derives_from rdfs:label "derives from" .

:derives_into rdfs:label "derives into" .

:hydrocarbon_gas rdfs:label "hydrocarbon gas" .

:kerogen rdfs:label "kerogen" .

:petroleum rdfs:label "petroleum" .

:planktonic_material rdfs:label "planktonic material" .

:sulfur_molecular_entity rdfs:label "sulfur molecular entity" .

,"Planktonic kerogen is a sub class of kerogen and it derives from certain values of planktonic material. This subclass also evolves into specific values sourced from the intersection of petroleum and hydrocarbon gas. The planktonic kerogen features increased levels of certain sulfur molecular entities. By definition, planktonic kerogen is enriched in sulfur compounds. It has a hydrogen to carbon ratio under 1.25, and an oxygen to carbon ratio ranging between 0.03 and 0.18. Moreover, it evolves into mixtures of hydrocarbon gas and oil, and predominantly stems from marine organic materials like lipids, which are formed in reducing environments."

@prefix : <https://zaitoun.dev/onto/> .
