    rdfs:subClassOf :planktonic_kerogen ;
    :has_definition "Planktonic kerogen which has high concentrations of sulfur compounds." .

:planktonic_kerogen rdfs:label "planktonic kerogen" .

,Sulfurous Kerogen is a subclass of Planktonic Kerogen and is defined by its high concentrations of sulfur compounds.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:humic_kerogen rdfs:label "humic kerogen" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :viridiplantae ],
        [ a owl:Restriction ;
            owl:onProperty :derives_into ;
            owl:someValuesFrom [ owl:unionOf ( :hydrocarbon_gas :coal ) ] ],
        :kerogen ;
    :has_definition "Kerogen which derives from land plants, resembles wood or coral in structure, has a hydrogen to carbon ratio under 1, an oxygen to carbon ratio between 0.03 to 0.3, and which primarily produces coal or hydrocarbon gas on degradation." .

:coal rdfs:label "coal" .

:derives_from rdfs:label "derives from" .

:derives_into rdfs:label "derives into" .

:hydrocarbon_gas rdfs:label "hydrocarbon gas" .

:kerogen rdfs:label "kerogen" .

:viridiplantae rdfs:label "Viridiplantae" .

,"Humic Kerogen is a subclass of Kerogen. It originates from certain values derived from Viridiplantae. This subclass evolves into certain values from either hydrocarbon gas or coal, or a combination of both. By definition, Humic Kerogen, which derives from land plants, has a structure similar to wood or coral. It has a hydrogen to carbon ratio of less than 1 and an oxygen to carbon ratio of 0.03 to 0.3. Upon degradation, it primarily produces coal or hydrocarbon gas."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:residual_kerogen rdfs:label "residual kerogen" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :polycyclic_hydrocarbon ],
        :hydrocarbon_based_environmental_material,
        :kerogen ;
    :has_definition "Kerogen which has a hydrogen to carbon ratio less than  0.5 and primarily composed of polycyclic aromatic hydrocarbons." .

:composed_primarily_of rdfs:label "composed primarily of" .

:hydrocarbon_based_environmental_material rdfs:label "hydrocarbon-based environmental material" .

:kerogen rdfs:label "kerogen" .

:polycyclic_hydrocarbon rdfs:label "polycyclic hydrocarbon" .

,"Residual kerogen is a subclass of several categories

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:forest_canopy rdfs:label "forest canopy" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :forest_ecosystem ],
        :canopy .

:canopy rdfs:label "canopy" .

:forest_ecosystem rdfs:label "forest ecosystem" .

:part_of rdfs:label "part of" .

,The forest canopy is a subclass of the canopy and is part of some values from the forest ecosystem.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:woodland_canopy rdfs:label "woodland canopy" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :woodland_ecosystem ],
        :canopy ;
    :has_definition "A canopy which is part of a woodland ecosystem." .

:canopy rdfs:label "canopy" .

:part_of rdfs:label "part of" .

:woodland_ecosystem rdfs:label "woodland ecosystem" .

,"A woodland canopy is a subclass of the canopy, and it is also a part of some values drawn from the woodland ecosystem. Furthermore, the woodland canopy has the definition: ""A canopy which is part of a woodland ecosystem."""

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:crop_canopy rdfs:label "crop canopy" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :cropland_ecosystem ],
        :canopy ;
    :has_definition "A canopy which is composed of the aboveground portion, or crowns, of a community of crop plants." .

:canopy rdfs:label "canopy" .

:cropland_ecosystem rdfs:label "cropland ecosystem" .

:part_of rdfs:label "part of" .

,"Crop canopy is a subclass of the canopy and also a part of certain values originating from the cropland ecosystem. By definition, a crop canopy is a canopy composed of the above-ground portion, or crowns, of a community of crop plants."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:canopy rdfs:label "canopy" ;
    rdfs:subClassOf :vegetation_layer ;
    :has_definition "A vegetation layer which is formed by a collection of individual plant crowns, themselves constituting part of the aboveground portion of a plant community." .

:vegetation_layer rdfs:label "vegetation layer" .

,"A canopy, which is a subclass of the vegetation layer, is defined as a vegetation layer formed by a collection of individual plant crowns. These crowns constitute part of the aboveground portion of a plant community."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:forest_ecosystem rdfs:label "forest ecosystem" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :forest_canopy ],
        :terrestrial_ecosystem ;
    :has_definition "An ecosystem which is determined by communities of plants with a tree growth form and in which members of those communities form continuous or discontinuous regions of canopy cover." .

:forest_canopy rdfs:label "forest canopy" .

:has_part rdfs:label "has part" .

:terrestrial_ecosystem rdfs:label "terrestrial ecosystem" .

,The forest ecosystem is a subclass of the terrestrial ecosystem and has parts that comprise of elements from the forest canopy. It is defined as an ecosystem which is characterized by communities of plants with a tree growth form. These communities form regions of continuous or discontinuous canopy cover.

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cropland_ecosystem rdfs:label "cropland ecosystem" ;
    rdfs:subClassOf :terrestrial_ecosystem ;
    :has_definition "An ecosystem which 1) is determined by communities of annual crops, perennial woody crops, or by actively tilled land, 2) is primarily used for agricultural activity, and 3) contains no village or larger human settlement." .

:terrestrial_ecosystem rdfs:label "terrestrial ecosystem" .

,"The cropland ecosystem is a sub-category of the terrestrial ecosystem. This ecosystem is characterized by communities of annual crops, perennial woody crops, or actively tilled land. It is primarily used for agricultural activities and does not include any human settlements like villages or larger human settlements.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:agricultural_process rdfs:label "agricultural process" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :occurs_in ;
            owl:someValuesFrom [ owl:unionOf ( :cropland_biome :village_biome :rangeland_biome ) ] ],
        [ a owl:Restriction ;
            owl:onProperty :occurs_in ;
            owl:someValuesFrom :planetary_landmass ],
        :anthropogenic_environmental_process ;
    owl:equivalentClass [ owl:intersectionOf ( :environmental_system_process [ a owl:Restriction ;
                        owl:onProperty :occurs_in ;
                        owl:someValuesFrom [ owl:unionOf ( :cropland_biome :village_biome :rangeland_biome ) ] ] ) ] ;
    :has_definition "A process during which humans rear animals or plants on land for harvest and consumption." ;
    :has_related_synonym "agriculture" .

:anthropogenic_environmental_process rdfs:label "anthropogenic environmental process" .

:environmental_system_process rdfs:label "environmental system process" .

:planetary_landmass rdfs:label "planetary landmass" .

:cropland_biome rdfs:label "cropland biome" .

:rangeland_biome rdfs:label "rangeland biome" .

:village_biome rdfs:label "village biome" .

:occurs_in rdfs:label "occurs in" .

,"The concept of the agricultural process is the same as the intersection of an environmental system process and occurs within certain values from the union of cropland, village, and rangeland biomes. This agricultural process is a subclass of the anthropogenic environmental process. It also takes place within some values from the planetary landmass and the union of the above mentioned biomes. Agriculture, a related synonym of the agricultural process, defines it as a process where humans rear animals or plants on land for harvest and consumption."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:agronomic_process rdfs:label "agronomic process" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :viridiplantae ],
        :agricultural_process ;
    :has_definition "An agricultural process during which humans rear plants on land for harvest and consumption." ;
    :has_related_synonym "agronomy" .

:agricultural_process rdfs:label "agricultural process" .

:has_participant rdfs:label "has participant" .

:viridiplantae rdfs:label "Viridiplantae" .

,"The agronomic process is a subclass of the agricultural process and also has a participant with some values from Viridiplantae. The definition of the agronomic process is an agricultural process during which humans rear plants on land for harvest and consumption. Furthermore, the related synonym for the agronomic process is agronomy."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:animal_husbandry rdfs:label "animal husbandry" ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :metazoa ],
        :agricultural_process ;
    :has_definition "An agricultural process during which humans rear animals on land for harvest and consumption." ;
    :has_related_synonym "agriculture" .

:agricultural_process rdfs:label "agricultural process" .

:has_participant rdfs:label "has participant" .

:metazoa rdfs:label "Metazoa" .

,"Animal husbandry, a subclass of the agricultural process, involves humans rearing animals on land for harvest and consumption. This practice, which has a subrelation with some values from Metazoa, is also related synonymously to agriculture."
